import React from "react";
import { mapIcon, mailIcon, callIcon } from "../assets/icons/index";

function IconWithInfo(props) {
  return (
    <div
      className="flex justify-start items-center text-sm p-2
    ">
      <img className="h-10 " src={props.icon} alt="{props.icon}" />
      <p className="px-6 py-2 w-80">{props.info}</p>
    </div>
  );
}

const ContactUs = () => {
  return (
    <div>
      <div className="flex flex-col w-full py-20 overflow-auto bg-primaryThree justify-center items-center">
        <div className="flex flex-col justify-center p-30 ">
          <h1 className="font-[itim] text-4xl tracking-tight py-3 justify-center items-center">
            Contact us
          </h1>

          <IconWithInfo
            icon={mapIcon}
            info={
              "16 Liffey Ave, Liffey Valley Park, Lucan,Co. Dublin, K78 HW50, Ireland"
            }
          />
          <IconWithInfo icon={mailIcon} info={"hello@earthly.ie"} />
          <IconWithInfo icon={callIcon} info={"+353 1552 4908"} />
        </div>
        <div className="contactUsForm">Contact us form</div>
      </div>
    </div>
  );
};

export default ContactUs;
